import { Text, View, StyleSheet } from "react-native";

const Subtitle = () => {
  return (
    <View style={styles.subtitleContainer}>
      <Text style={styles.subtitle}>Steps</Text>
    </View>
  );
};

export default Subtitle;

const styles = StyleSheet.create({});
